#' A vCard-in-JSON message that contains only the fields needed for PAWS:  - fn: Full name of an individual - org: Name of the organization - adr: Address fields - tel: Telephone numbers - email: Email addresses
#' 
#' @param adr The street address of the entity
#' @param email An email address that can be used to reach the contact
#' @param fn The full name of the contact person
#' @param org The organization associated with the registering entity
#' @param tel A telephone number that can be used to call the contact
#' 
#' @return Vcard object
#' 
#' @family Vcard functions
#' @export
Vcard <- function(adr = NULL, email = NULL, fn = NULL, org = NULL, tel = NULL) {
    structure(list(adr = adr, email = email, fn = fn, org = org, tel = tel), class = "gar_Vcard")
}

